package net.prottonne.lab.image.controller;

import net.prottonne.lab.common.util.auth.JwtUtil;
import net.prottonne.lab.common.util.header.constant.HeaderConstant;
import net.prottonne.lab.image.entity.RequestImage;
import net.prottonne.lab.image.entity.ResponseImage;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.http.MediaType;
import org.springframework.web.bind.annotation.RequestBody;
import org.springframework.web.bind.annotation.RequestHeader;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.RestController;

/**
 *
 * @author Jose Osuna
 */
@RestController
public class ImageController {

    private final Logger logger = LoggerFactory.getLogger(this.getClass());

    @RequestMapping(
            value = "/profile",
            method = RequestMethod.POST,
            produces = {MediaType.APPLICATION_JSON_VALUE}
    )
    public ResponseImage getImageProfile(
            @RequestHeader(value = HeaderConstant.AUTHORIZATION_HEADER) String header,
            @RequestBody RequestImage requestImage
    ) {
        JwtUtil.validateJwtToken(header);
        logger.info("requestImage {}", requestImage);

        ResponseImage responseImage = new ResponseImage();
        responseImage.setImage("data:image/jpeg;base64,");

        return responseImage;
    }

}
